//Based on Sébastien Hillaire's way of bringing in a custom texture, seen in this shader (buffer c):https://www.shadertoy.com/view/7dVGWR
//This is a workaround for not having an option to upload a custom texture, and its not an ideal way by any means.
//The arrays were generated using a script I made for it, and the output of that is simply copy-pasted into here (buffer a).

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;

//make square 
float ratio = iResolution.x/iResolution.y;
uv.x*=ratio;


vec3 tex =pow(texture(iChannel0,uv).xyz,vec3(0.4545));
    // Output to screen
    fragColor = vec4(tex,1.0);
}
